import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class Hello extends Component {
    constructor(props) {
        super(props);
        this.state = {
            message: "Hello"
        };
    }

    render() {
        return <h1>{this.state.message}</h1>;
    }
}

ReactDOM.render(<Hello />, document.getElementById('root'));
